import React from 'react'
import '../styles/red'

const Redirect = () => {
    return(
        <div className="redirect">
            <h1 id="redirect_header">Thank you for voting</h1>
            <p id="rdirect_text">
                Wait for the result from the Admin
            </p>
        </div>
    )
}

export default Redirect
